#*# CIRCUMFLEX
#   dead_circumflex
#   Multi_key: ¦<
#
#   Followed by quotedbl, apostrophe or rightsinglequotemark, dead_circumflex
#   yields turned high curly quotation marks U2018, U201C (opening or closing).
#   See # # Quotation mark input method
#
#   The polygrams -êk-, -êl-, -êm-, -ên-, -êp-, -êq-, -êr-, -êt-, -êv-, -êch-
#   make dead_circumflex behave like an Ê key in most cases by using the fact
#   that the letters k, l, m, n, p, q, r, t, v, x do not exist as precomposed
#   letters with circumflex accent, and most of these are not in usage either
#   with combining circumflex as known composed letters. Those that are, will
#   need to be overridden, so as to prioritize the Ê key emulation sequences.
#   French usage information: Courtesy _La fée des lettres_.
#   https://www.motsavec.com
#
#   The following are the sequences included despite being overridden:
#   <dead_circumflex><M> : "M̂" # U004D U0302 LATIN CAPITAL LETTER M WITH CIRCUMFLEX: Min Nan
#   <dead_circumflex><m> : "m̂" # U006D U0302 LATIN SMALL LETTER M WITH CIRCUMFLEX: Min Nan
#   <dead_circumflex><N> : "N̂" # U004E U0302 LATIN CAPITAL LETTER N WITH CIRCUMFLEX: Min Nan
#   <dead_circumflex><n> : "n̂" # U006E U0302 LATIN SMALL LETTER N WITH CIRCUMFLEX: Min Nan
#   Courtesy https://www.frathwiki.com/Circumflex
#
#   Cross-platform compatibility is full on MacOS, but only partial on Windows.
#   Windows is able to support only lowercase, and only digrams — provided that
#   the dead key is assigned the appropriate dead character. For the circumflex
#   accent dead key, that is U00EA "ê" LATIN SMALL LETTER E WITH CIRCUMFLEX.
#
#   Likewise, a Ç key is emulated for use on the Canadian French variant.
#   See #*# CEDILLA
#
#   The circumflex dead key is also expected to support superscript digits, for
#   the sake of conformance with NF Z71-300:2019, section 6.3.3 page 24, and as
#   a tribute to the German E DIN 2137-1:2020-11 that has been synced, but only
#   with the digits part, not the signs and parentheses.
#   https://de.wikipedia.org/wiki/DIN_2137#%C3%9Cberarbeitung_2020
#
#   But the Multi_key equivalent of this way to input superscript digits cannot
#   be supported, since it conflicts with "❤" U2764 as of "³" U00B3, and with a
#   new sequence introduced for the less frequent "♥" U2665 as of "⁸" U2078. So
#   the numeric base characters are propagated from compose sequences for heart
#   emoji that are duplicated here for consistency, and completed consistently.
#   See #   Heart emoji
#
#   As a result, superscript by dead_circumflex is dropped entirely, given that
#   for portability, all Multi_key equivalents must be supported.
#
#   The diaeresis dead key offers an acceptable alternative with good mnemonics
#   using the traditional mapping on the same key in shift position.
#   See #*# DIAERESIS
#
#   Ultimately, this feature is non-critical since a dedicated superscript dead
#   key is also present, in NF Z71-300:2019 too.
#   See #*# SUPERSCRIPT
#
#   Moreover, superscript and subscript digits are on live keys.
#
#   NOTE: In en_US.UTF-8/Compose that the superscript digits by dead_circumflex
#   feature comes from, the superscript dead key is missing, consistently with
#   the *dead_superscript or equivalent keysym missing in keysymdef.h.
#
#   Followed by Çç, circumflex is a shortcut to Ññ for Breton and Spanish.
#
#   U017F LATIN SMALL LETTER LONG S, in group 3 of s, has an additional input
#   method by <dead_circumflex><f> since French has no words including an -êf-.
#   Plus, <dead_circumflex><dollar> also yields the same small letter.
#
#   Likewise, U2300 DIAMETER SIGN, in group 1 of (, is given yet another input
#   method by <dead_circumflex><d>, <dead_circumflex><D> due to the fact that
#   French does not have any word with -êd-.
#
#   U016C LATIN CAPITAL LETTER U WITH BREVE is used in Esperanto and has thus a
#   shortcut by <dead_circumflex><B>, and U016D LATIN SMALL LETTER U WITH BREVE
#   may alternatively be input by <dead_circumflex><b>. as French doesn’t have
#   any word with -êb-. Another pair of shortcuts uses Ugrave, since U has not
#   been encoded with circumflex and grave, as opposed to A, E and O.
#
#   Followed by comma, dead_circumflex provides a shorthand for
#   U200C ZERO WIDTH NON-JOINER, and by asterisk, for U2042 ASTERISM.
#
#   Supporting the Mathematical Alphanumeric Symbols high surrogate is designed
#   for portability, but on Linux and ChromeOS it is ineffective.
#
