#
#
#*# FLAG_LETTER, DOUBLE
#   *dead_flag UEFD7
#   Multi_key: ¦=
#
#   In XKB, on single press, letters yield regional indicator symbols with an
#   appended ZWNJ for letter emoji display and writing words.
#
#   The full set of existing flag emoji is supported on double press.
#   See #^# REGIONAL_INDICATOR_SYMBOL_PAIR
#
#   Regional indicator symbols in isolation are supported on triple press.
#   See #^# REGIONAL_INDICATOR_SYMBOL
#
#   Digits yield double arrows as a redundant facility to meet most common user
#   expectations. Single arrows are yielded by dead_horn.
#   See #*# HORN, DESCENDER, NOTCH
#
#   Symbols other than "⹀" U2E40 DOUBLE HYPHEN as a feature for lexicography
#   (with respect to this, mathematical symbols use <Multi_key><minus><equal>)
#   cannot be supported in group 0 due to numerous conflicts with composition.
#
#   Mathematical symbols are also supported by DIAERESIS as a shortcut for
#   DOUBLE, unless a quick access sequence conflicts with regular support.
#   See #*# DIAERESIS
#
#
#   Cross-platform compatibility
#
#   Windows supports an extra modifier added on Caps Lock for continuous input,
#   and also for composing flags. As in continuous input, ZERO WIDTH NON-JOINER
#   should be appended, on Windows, Shift would held down when inputting flags.
#
#   MacOS supports an iterative dead key for continuous input, on triple press.
#   As XKB has no support for iterative dead keys, the behavior of single press
#   and triple press is swapped, with single press outputting an appended ZWNJ,
#   and triple press outputting regional indicator symbol letters in isolation.
#
#   In en_US.UTF-8/Compose, sequences starting with ¦= conflict with currency signs
#   and double acute, given that en_US.UTF-8/Compose uses ¦", not ¦:, for diaeresis,
#   and so cannot use ¦" for <dead_doubleacute>, but must use ¦= instead.
#   Restricting currency signs to EQUALS SIGN *after* letter solves this issue.
#   See # # Currency symbols
#
#
#   Auxiliary characters
#
#   Auxiliary characters are supported with base characters in synergy:
#   The Multi_key equivalents are impractical, but full ASCII equivalents
#   would conflict with mathematical symbols.
#
#   *  ZWNJ is used to prevent an ISO code letter pair from being displayed
#      as a flag;
#   *  WJ is used to prevent an RI character from breaking off a character of
#      another class;
#   *  Supporting the high surrogate is designed for portability, but on Linux
#      and ChromeOS it is ineffective.
#
#
#   Head character
#
#   For iconicity, the sequences with spaces that yield combining diacritics on
#   most deadkeys, output a white flag, like dead_currency outputs ¤, since the
#   flag used as a base character for subdivision flags is in the SMP:
#   "🏴" U1F3F4 WAVING BLACK FLAG
#   Nevertheless, for completeness, this waving black flag is output when using
#   backslash as a base character.
#
#   Likewise, the sequences with nobreak space and nobreak thin space, used for
#   spacing diacritics on most deadkeys, output the matching black flag.
#
