#
#
#
#   START_GROUP_SELECTOR
#
#
### Group selector introduction
#
#   The private use character UEFB0 is used as the group selector dead key.
#   Patch for *dead_group <UEFD0>, for addition to en_US.UTF-8/Compose.
#   As a special dead key, the group selector deserves particular attention.
#
#
# # Numbering
#
#   CAUTION: Unlike specified in ISO/IEC 9995, group numbers are zero based.
#   For UX consistency, the default group is group 0. Only groups accessed by
#   the group selector dead key are numbered starting with 1, because a group
#   accessed by an n-uple press on the group selector must be called “group n”,
#   not “group n+1”. The ISO/IEC 9995 standard uses 1-based numbering because
#   it uses the terms “primary” and “secondary” with respect to groups, and it
#   does not consider dead key based group selection with multiple presses.
#
#   The short identifier for group n is gn.
#
#
# # History
#
#   The group selector dead key has been introduced by Karl Pentzlin while
#   implementing DIN 2137-2:2012 on Windows. Virtual dead keys accessed by
#   multiple dead key presses have been introduced by the French ergonomic
#   bépo keyboard layout project in 2015 while upgrading to version 1.1 for
#   the NF Z71-300:2019 standard.
#
#   *dead_group is used when levels are exhausted by Level5 modifier and toggle.
#   XKB supports the ISO/IEC 9995 conformant group selection since 2013, see
#   https://bugs.freedesktop.org/show_bug.cgi?id=60991
#   But its keysym mapping array is limited to a maximum number of 8 elements,
#   used up by the extra graphic modifier key required to support input methods
#   for the standard digital representation of numbers and measurement units
#   according to the Bureau International des Poids et Mesures BIPM, and of
#   French text using U202F NARROW NO-BREAK SPACE to space out big punctuation
#   marks following the French Imprimerie Nationale and French new-school
#   typesetting practice.
#
#
# # Cross-platform compatibility
#
#   Implementing the group selector as a dead key avoids breaking UX across
#   platforms, as Windows supports 6 + 1 modifiers but unsupports the ISO group
#   selector combo Shift + AltGr, and Apple has broken its technote TN2056 as
#   of around 2015 after previously allowing to use left Option as an extra
#   modifier, used by the German Neo ergonomic keyboard layout later emulating
#   left Option using the Karabiner Elements software from Takayama Fumihiko.
#
#
# # Maintenance
#
#   Filling empty slots with null output "" U0000 can be avoided. The "" U0000
#   strings have been removed for ease of maintenance on 2023-01-13T1356+0100.
#
#
#
### Space and symbol groups
#
#   The base characters in this section are mapped on AltGr/Option or unshifted
#   keys as of comma, period and space. Symbols and punctuation mapped on level
#   three assume using the group selector in synergy on AltGr/Option.
#
#   Consistently this section is ordered by keys rather than by code points, as
#   the order of the ASCII symbols on the keyboard layout is used for mnemonics
#   in synergy with the learning curve required by using the base alphabet as a
#   means to remember the symbols.
#
#
# # Ordinal indicators
#
#   French ordinal indicators are the preformatted superscript letters ᵈᵉʳˢ,
#   mapped to the AltGr + AltFr level, plus facilities for ᵉ and ʳ in AltGr.
#   The two Latin-1 ordinal indicators may be keyed in as a part of group 1,
#   on A and O respectively — Keys of F and M would be a bit less intuitive.
#   However, the base characters are asciicircum on A, and quotedbl on O, as
#   mapping them to alphabetic in group 1 is counterproductive by wasting as
#   much as four casing positions.
#   See ### Space and symbol groups
#
#
#   Emoji
#
#   Supporting all emoji in the Basic Multilingual Plane except Chinese letter
#   emoji makes sense because input by dead keys is cross-platform compatible.
#
#   A number of BMP emoji are supported alternatively or only elsewhere:
#
#       * See # # Legal symbols
#       * See # # Western zodiacal signs emoji
#       * See # # Emoji
#       * See #   Arrow emoji
#
#   A number of Supplemental Multilingual Plane emoji are mapped on live keys.
#
#   The two emoji-related variation selectors are in group 10 on key E, D03,
#   for emoji style, VS16 UFE0F, and on key T, D05, for text style, VS15 UFE0E.
#
#   The five emoji skin tone modifiers based on the 6-shades Fitzpatrick scale
#   are in group 10 on D06..D10.
#
#   Emoji full list: https://unicode.org/emoji/charts/full-emoji-list.html
#   The source list: https://unicode.org/Public/emoji/13.0/emoji-sequences.txt
#   The specification: https://unicode.org/reports/tr51/
#
#   Emoji frequency figures are based on:
