#
#
# # A03-level1
#
#   The preferred name and abbreviation of U2009 are NARROW SPACE, NSP.
#   An alternate, more intuitive name of U200B is WORD NON-JOINER.
#   https://github.com/unicode-org/cldr/blob/main/tools/cldr-code/src/main/java/org/unicode/cldr/util/CodePointEscaper.java
#   For consistency, WNJ is used in documentation rather than ZWSP.
#   https://unicode-org.atlassian.net/browse/CLDR-16631
#
#   The French name of U200B is CÉSURE CONDITIONNELLE, break opportunity.
#
#   For ease of input, U2002 and U2003 are on level 1, although they were
#   originally intended to be no-break. That brings the need to put their
#   breaking clones on level3, since they are now canonically equivalent.
#   U2002..U2006 and U2008..U200A were originally intended to be no-break
#   just like U2007 FIGURE SPACE.
#
#   Unlike stated in UAX #14, U2007 is not intended for use *in* figures,
#   but *before* figures for indentation in tables. Therefore, it is also
#   called tabular digit space, as opposed to tabular punctuation space.
#   https://www.unicode.org/reports/tr14
#
#   U205F MEDIUM MATHEMATICAL SPACE is a breaking 4/18 em, or 4½-per-em.
#
#   U3000 IDEOGRAPHIC SPACE does not hang into the margin.
#
