### Letter groups
#
#   On the alphabet, the groups yield:
#
#   Group  0  (g0): live keys (default, no group selected);
#   Group  1  (g1): group selector pressed once: Latin;
#   Group  2  (g2): group selector pressed twice: Latin;
#   Group  3  (g3): group selector pressed thrice or followed by digit 3: Latin;
#   Group  4  (g4): group selector pressed 4 times or followed by digit 4: Latin;
#   Group  5  (g5): group selector then digit 5: Latin;
#   Group  6  (g6): group selector then digit 6: Greek and Greek math symbols;
#   Group  7  (g7): group selector then digit 7: Latin script style math symbols;
#   Group  8  (g8): group selector then digit 8: Latin doublestruck/bold/italic math symbols;
#   Group  9  (g9): group selector then digit 9: Latin fraktur/monospace math symbols;
#   Group 10 (g10): group selector then digit 0: Latin sans-serif math symbols;
#   Group 11 (g11): group selector then digit 1: Latin;
